import React, { useEffect } from 'react';

import { useRouteMatch } from 'react-router-dom';

const EditP = ({ props }) => {
    const match = useRouteMatch()
    useEffect(() => {
        console.log(match.param.id);
    }, [props]);

    return (
        <div>Edit Page</div>
    );
}

export default EditP;
